First, let's add the numbers column by column, starting from the rightmost column.

Column 1 (ones place): 5 + 8 = \boxed{D}

Column 2 (sixteens place): 6 + 0 = \boxed{6}

Column 3 (256s place): 8 + E. Since E is equivalent to 14 in base-10, we have 8 + 14 = 22. In base-16, 22 is represented as \boxed{16}.

So, the sum is \boxed{16D6}.
